import React  from 'react'
import { useContext } from 'react';
import OmnibusContext from 'context/OmnibusContext';

const OmnibusCrud = () => {
    const { omnibus } = useContext(OmnibusContext);

  return (
      <>
       {omnibus.map((om)=>(
           <ul key={om.pk}>
               <li>{om.numero}</li>
           </ul>
       ))}
      </>
  )
}

export default OmnibusCrud
